import React, {Component, useState} from 'react';
import Row from 'react-bootstrap/Row';
import logo_img from './logo.jpg';
import Col from 'react-bootstrap/Col'
import { Container } from 'react-bootstrap';

 function HeaderComponent (props) {
            return (

                    <Row className="shadow" style={{position:"fixed"}}> 
                        <img style={{marginLeft:"20px",padding:"5px",width:"60px",height:"60px"}} src={logo_img}/>
                        <Col>
                            <p style={{fontFamily:"Muli",fontSize:"35px",fontWeight:"bold"}}>Enyo Frontend</p>
                        </Col>  
                        <Col xs={12} md={8}>
                            <form >
                            <input
                                style={{outline:"none",backgroundColor:"none",borderWidth:"0 0 2px",borderColor:"#61aaf2",marginTop:"20px"}}
                                className="w-50" type="text" placeholder="Name" aria-label="Search" />                            
                            </form> 
                        </Col>                      
                    </Row>

            )
    }

export default HeaderComponent;
